import styled from "styled-components";
import { Typography, Button } from "antd";
const { Text, Paragraph } = Typography;

export const containerCol = { xs: 24, sm: 11, md: 9, lg: 7, xl: 8 };

export const Container = styled.div`
	width: 100%;
	height: 100vh;

	display: flex;
	flex-direction: column;
	align-items: center;
`;

export const RowsContainer = styled.div`
	display: flex;
	flex-direction: row;
	justify-content: space-around;
`;

export const GoodBadContainer = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
	width: ${(props) => (props.width ? props.width : 48)}%;
	height: 100%;
`;

export const FooterContainer = styled.div`
	width: 100%;
	height: 80vh;
	background: linear-gradient(#f8df6e, #fff);
	display: flex;
	flex-direction: column;
	align-items: center;
`;

export const WidthImg = styled.img`
	display: block;
	margin: 0;
	max-width: 100%;
	min-width: 100%;
	height: auto;
`;

export const Texty = styled.p`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;

	text-align: center;
	display: block;
	margin-top: ${(props) => (props.top ? props.top : 0)}px;
	margin-bottom: ${(props) => (props.bottom ? props.bottom : 0)}px;
	font-size: ${(props) => (props.font ? props.font : 0)}px;
	color: ${(props) => (props.color ? props.color : "#333333")};
`;

export const Paragraphy = styled.p`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;

	text-align: center;
	display: block;
	margin-top: ${(props) => (props.top ? props.top : 0)}px;
	margin-bottom: ${(props) => (props.bottom ? props.bottom : 0)}px;
	font-size: ${(props) => (props.font ? props.font : 0)}px;
	color: ${(props) => (props.color ? props.color : "#333333")};
`;

export const LineBreakText = styled.p`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;
	width: 100%;
	height: auto;
	text-align: center;

	word-break: break-word;
	margin-top: ${(props) => (props.top ? props.top : 0)}px;
	margin-bottom: ${(props) => (props.bottom ? props.bottom : 0)}px;
	font-size: ${(props) => (props.font ? props.font : 0)}px;
	color: ${(props) => (props.color ? props.color : "#333333")};
`;

export const GoodBadBtn = styled.button`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;

	display: block;
	background: transparent;
	border: none;
	cursor: pointer;
	outline: none;
`;

export const ActionBtn = styled.button`
	@import url("https://fonts.googleapis.com/css2?family=Poor+Story&display=swap");
	font-family: "Poor Story", cursive;
	background: #eeeeee !important;
	color: #000000 !important;
	border: none;
	border-radius: 3px;
	display: block;
	width: 60vw;
	cursor: pointer;
	font-size: 20px;
	padding: 10px;
	margin-bottom: 20px;

	@media (hover: hover) and (pointer: fine) {
		&:hover {
			background: #f66a70 !important;
			color: #ffffff !important;
		}
	}
`;

export const IconBtn = styled.button`
	width: 20vw;
	height: 20vw;
	background-color: #ddd;
	border: none;
	cursor: pointer;
	display: flex;
	justify-content: flex-end;
	background: url("/assets/images/result/share_kakao.png") no-repeat top left;
`;

export const Square = styled.div`
	width: 50px;
	height: 0;
	padding-bottom: 50px;
	background: url(${(props) => (props.url ? props.url : "")}) no-repeat top
		left;
`;
